import React from "react";
import { FaTachometerAlt, FaBox, FaUser, FaCogs } from "react-icons/fa";
import '../../App.css';


const Sidebar = () => {
  return (
    <div className="sidebar">
      <h2 className="sidebar-title">Dashboard</h2>
      <ul className="sidebar-menu">
        <li><FaTachometerAlt /> Dashboard</li>
        <li className="active"><FaBox /> Devices</li>
        <li><FaUser /> Reseller</li>
        <li><FaCogs /> Profile</li>
      </ul>
    </div>
  );
};

export default Sidebar;
